webpackJsonp([0xd63633031d81],{727:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Getting started is easy. All you need to do is click the <strong>Connect with STRAVA</strong> button in the upper right corner. You will be redirected to Strava to sign in and they will return you, logged in and ready to go.</p>\n<hr>\n<p><strong>araceathlete.com is a free companion app for Strava that lets you do more with your data.</strong></p>\n<h2>Features</h2>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.07766990291263%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Weekly Stats"\n        title=""\n        src="/blog/static/weekly-stats-cover-33dbd799663781ecaa9c69f4e3382028-31818.png"\n        srcset="/blog/static/weekly-stats-cover-33dbd799663781ecaa9c69f4e3382028-b3e18.png 103w,\n/blog/static/weekly-stats-cover-33dbd799663781ecaa9c69f4e3382028-571c4.png 206w,\n/blog/static/weekly-stats-cover-33dbd799663781ecaa9c69f4e3382028-31818.png 412w,\n/blog/static/weekly-stats-cover-33dbd799663781ecaa9c69f4e3382028-1be92.png 618w,\n/blog/static/weekly-stats-cover-33dbd799663781ecaa9c69f4e3382028-05b5b.png 824w,\n/blog/static/weekly-stats-cover-33dbd799663781ecaa9c69f4e3382028-17809.png 1236w,\n/blog/static/weekly-stats-cover-33dbd799663781ecaa9c69f4e3382028-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Your week at a glance with metrics accumulation, gear totals and activity data breakdowns.</p>\n<ul>\n<li>Accumulation Charts show you have you’ve stacks the days total on top of the past week for key metrics such as Distance, Elevation, and Time as well as extended data such as TSS, Suffer Score, Kilojoules, and Calories.</li>\n<li>Gear breakdown shows you the accumulation of key metrics by gear.</li>\n<li>Comprehensive data breakdown for each activity.</li>\n</ul>\n<p><a href="https://www.araceathlete.com/blog/weekly-stats" target="_blank" rel="nofollow">Learn more about Weekly Stats</a></p>\n<hr>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.07766990291263%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Activity Search"\n        title=""\n        src="/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-31818.png"\n        srcset="/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-b3e18.png 103w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-571c4.png 206w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-31818.png 412w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-1be92.png 618w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-05b5b.png 824w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-17809.png 1236w,\n/blog/static/activity-search-cover-820a41d147fb4f2f181498178931fd4e-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Find any activity you’ve ever done on Strava using keywords, location, date, and a host of other filters.</p>\n<ul>\n<li>Text Search can use either keywords or precision text and results can be sorted on key metrics.</li>\n<li>Location Search lets you drop a pin on a map and return the within a specified radius, sorted by their proximity to your pin.</li>\n</ul>\n<p><a href="https://www.araceathlete.com/blog/activity-search" target="_blank" rel="nofollow">Learn more about Activity Search</a></p>\n<hr>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.07766990291263%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Events"\n        title=""\n        src="/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-31818.png"\n        srcset="/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-b3e18.png 103w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-571c4.png 206w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-31818.png 412w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-1be92.png 618w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-05b5b.png 824w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-17809.png 1236w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<p>A community curated list of events that helps you organize, plan and track your season.</p>\n<ul>\n<li>Find or create events you are interested in and favorite them. Then filter your list on your favorites and you have a handy season schedule.</li>\n<li>Events have a common  format so it is easy to find the information quickly, as well as links to the event organizers home page.</li>\n<li>Five days prior to the event, location and date are used to provide weather forecasts.</li>\n<li>Extended information such as time zone and starting elevation which can be handy when planning sleep or power targets.</li>\n</ul>\n<p><a href="https://www.araceathlete.com/blog/events" target="_blank" rel="nofollow">Learn more about Events</a></p>\n<hr>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.07766990291263%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Power at Altitude"\n        title=""\n        src="/blog/static/power-at-altitude-cover-af686a9695978440f571ece68239945f-31818.png"\n        srcset="/blog/static/power-at-altitude-cover-af686a9695978440f571ece68239945f-b3e18.png 103w,\n/blog/static/power-at-altitude-cover-af686a9695978440f571ece68239945f-571c4.png 206w,\n/blog/static/power-at-altitude-cover-af686a9695978440f571ece68239945f-31818.png 412w,\n/blog/static/power-at-altitude-cover-af686a9695978440f571ece68239945f-1be92.png 618w,\n/blog/static/power-at-altitude-cover-af686a9695978440f571ece68239945f-05b5b.png 824w,\n/blog/static/power-at-altitude-cover-af686a9695978440f571ece68239945f-17809.png 1236w,\n/blog/static/power-at-altitude-cover-af686a9695978440f571ece68239945f-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Using your Strava FTP and Location, a table is generated with your acclimated and non-acclimated power percentages with zone charts.</p>\n<p><a href="https://www.araceathlete.com/blog/power-at-altitude" target="_blank" rel="nofollow">Learn more about Power at Altitude</a></p>\n<hr>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 70.04160887656033%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Power and Weight"\n        title=""\n        src="/blog/static/power-and-weight-cover-e401d4b6fea8911816a964cda1169cf4-31818.png"\n        srcset="/blog/static/power-and-weight-cover-e401d4b6fea8911816a964cda1169cf4-b3e18.png 103w,\n/blog/static/power-and-weight-cover-e401d4b6fea8911816a964cda1169cf4-571c4.png 206w,\n/blog/static/power-and-weight-cover-e401d4b6fea8911816a964cda1169cf4-31818.png 412w,\n/blog/static/power-and-weight-cover-e401d4b6fea8911816a964cda1169cf4-1be92.png 618w,\n/blog/static/power-and-weight-cover-e401d4b6fea8911816a964cda1169cf4-05b5b.png 824w,\n/blog/static/power-and-weight-cover-e401d4b6fea8911816a964cda1169cf4-17809.png 1236w,\n/blog/static/power-and-weight-cover-e401d4b6fea8911816a964cda1169cf4-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Using your Strava FTP and Weight, charts are generated showing your power to weight ratio over time.</p>\n<p><a href="https://www.araceathlete.com/blog/power-and-weight" target="_blank" rel="nofollow">Learn more about Power and Weight</a></p>\n<hr>\n<blockquote>\n<p>Some features require Strava Premium and/or A Race athlete Club Membership (free). For more information on how that works, see the <a href="https://www.araceathlete.com/blog/feature-requirements" target="_blank" rel="nofollow">Feature Requirements page</a></p>\n</blockquote>',frontmatter:{title:"Welcome to A Race athlete",date:"2017-06-01T00:19:00.000Z",path:"/welcome-to-araceathlete/",parent:"/home/hypersprite/Documents/code/araceathlete-gatsby-material-ui-v1/src/pages/blog-posts/welcome-to-araceathlete.md absPath of file",tags:"newbie",description:null,cover:null}}},pathContext:{slug:"/blog-posts/welcome-to-araceathlete/"}}}});
